import React from 'react';
import '../../styles/scheduleview.css'
export default function ScheduleViewer() {
  const days = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];
  const times = ['8:00', '9:00', '10:00', '11:00', '12:00', '13:00', '14:00', '15:00', '16:00', '17:00'];

  return (
    <div className="schedule">
      <div className="schedule-row">
        <div className="schedule-cell empty"></div>
        {days.map((day, index) => (
          <div key={index} className="schedule-cell day-name">{day}</div>
        ))}
      </div>
      {times.map((time, index) => (
        <div key={index} className="schedule-row">
          <div className="schedule-cell time">{time}</div>
          {days.map((dayName, dIndex) => (
            <div key={dIndex} className="schedule-cell">{/* Your content for each cell goes here */}</div>
          ))}
        </div>
      ))}
    </div>
  );
}
